      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - 66 + - col1 ) BETWEEN - 60 * - col0 AND ( - 77 + - CAST ( - 13 AS INTEGER ) );
  - name: tab1

outputs:
